import React, { useState } from 'react';

interface AthleteForm {
  name: string;

}

interface SlideData extends AthleteForm {
  result: any;
  side: "L" | "R";
  step: number;
  time: number;
  missedCone: number;
  kickCone: number;
}

const Slide = () => {


  return (
    <div className='App'>
      <div className='title'>
        <p>Slide Record</p>

      </div>
    </div>
  );
};

export default Slide;
